    public List<Balance> init(){
        Map<String, Object> parameters = new LinkedHashMap<>();
        String result =  spotClient.createTrade().account(parameters);

        ObjectMapper objectMapper = new ObjectMapper();
        JsonNode rootNode = null;
        try {
            rootNode = objectMapper.readTree(result);
        } catch (JsonProcessingException e) {
            throw new RuntimeException(e);
        }

        JsonNode balancesNode = rootNode.get("balances");

        List<Balance> balances = new ArrayList<>();

        if (balancesNode.isArray()) {
            for (JsonNode balanceNode : balancesNode) {
                String asset = balanceNode.get("asset").asText();
                String free = balanceNode.get("free").asText();
                String locked = balanceNode.get("locked").asText();

                Balance balance = new Balance(asset, free, locked);
                balances.add(balance);
            }
        }

        balanceList=balances;
        return balances;

    }
