    private boolean isValidArbitrage(PairData tickerA, PairData tickerB, PairData tickerC) {


        String ticker1[] = parseSymbol(tickerA.getSymbol());
        String ticker2[] = parseSymbol(tickerB.getSymbol());
        String ticker3[] = parseSymbol(tickerC.getSymbol());

        if(!(ticker1[0].equals(coin_)
                || ticker1[1].equals(coin_)
                || ticker2[0].equals(coin_)
                || ticker2[1].equals(coin_)
                || ticker3[0].equals(coin_)
                || ticker3[1].equals(coin_)

        )) {
            return  false;
        }

        Map<String, Integer> countMap = new HashMap<>();
        countOccurrences(countMap, ticker1[0]); // Count base of ticker1
        countOccurrences(countMap, ticker1[1]); // Count quote of ticker1
        countOccurrences(countMap, ticker2[0]); // Count base of ticker2
        countOccurrences(countMap, ticker2[1]); // Count quote of ticker2
        countOccurrences(countMap, ticker3[0]); // Count base of ticker3
        countOccurrences(countMap, ticker3[1]); // Count quote of ticker3

        // Check if all bases and quotes occur exactly 2 times
        return countMap.values().stream().allMatch(count -> count == 2);
    }
    private void countOccurrences(Map<String, Integer> countMap, String symbolPart) {
        countMap.put(symbolPart, countMap.getOrDefault(symbolPart, 0) + 1);
    }
